import React from "react";

import "./Projects.css";

const Project = () => {
  return (
    <div className="Project d-flex flex-column justify-content-center">
      <div class="card-container border">
        <div class="card-flip">
          <div class="front">
            <h1 style={{ width: "20vw", height: "20vh" }}>Hello</h1>
          </div>
          <div class="back">
            <h1 style={{ width: "20vw", height: "20vh" }}>Good Bye</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Project;
